import '../styles/message.css'

type TMessageData = {
  body: string,
  id: number,
  title: string
}

export function Message(props: TMessageData) {
  return (
    <div>
      <span>{props.title}</span>
      <p>{props.body}</p>
      <span>{props.id}</span>
    </div>
  )
}
